  true,\n\t\"url\": null,\n\t\"notes\": \"The Culturally Based Education for American
  Indian/Alaska Native Students: School Feasibility Survey, 2003-04 (CBE 2003-04)
  is a survey that is part of the Regional Educational Laboratory Program (REL) program.
  CBE 2003-04 (http://ies.ed.gov/ncee/edLabs/regions/) was a cross-sectional survey
  that assessed the feasibility of conducting experimental research in culturally
  based education (CBE) programs. The study was conducted using paper questionnaires
  and telephone follow-ups of educators. Educators of CBE programs were sampled. Key
  statistics produced from CBE 2003-04 can be used to inform a request for proposal
  for a feasible experimental study of culturally based education. The results can
  also be used to design new programs or funding initiatives that combine program
  development with embedded experimental research to test the effectiveness of new
  approaches.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
